void pool_hw::thread_hdltv_gen() {
    const char* dump_tv = std::getenv("AP_WRITE_TV");
    if (!(dump_tv && string(dump_tv) == "on")) return;

    wait();

    mHdltvinHandle << "[ " << endl;
    mHdltvoutHandle << "[ " << endl;
    int ap_cycleNo = 0;
    while (1) {
        wait();
        const char* mComma = ap_cycleNo == 0 ? " " : ", " ;
        mHdltvinHandle << mComma << "{"  <<  " \"ap_rst_n\" :  \"" << ap_rst_n.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"ap_start\" :  \"" << ap_start.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"ap_done\" :  \"" << ap_done.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_idle\" :  \"" << ap_idle.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_ready\" :  \"" << ap_ready.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"cifm_TDATA\" :  \"" << cifm_TDATA.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"cifm_TVALID\" :  \"" << cifm_TVALID.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"cifm_TREADY\" :  \"" << cifm_TREADY.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"cofm_i_TDATA\" :  \"" << cofm_i_TDATA.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"cofm_i_TVALID\" :  \"" << cofm_i_TVALID.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"cofm_i_TREADY\" :  \"" << cofm_i_TREADY.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"cofm_o_TDATA\" :  \"" << cofm_o_TDATA.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"cofm_o_TVALID\" :  \"" << cofm_o_TVALID.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"cofm_o_TREADY\" :  \"" << cofm_o_TREADY.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"tran_wgt\" :  \"" << tran_wgt.read() << "\" ";
        mHdltvinHandle << "}" << std::endl;
        mHdltvoutHandle << "}" << std::endl;
        ap_cycleNo++;
    }
}

